    true,nt"url": null,nt"notes": "<p>Pioneer ACO PUF - To address the increasing
    number of requests for Pioneer ACO data, the Centers for Medicare and Medicaid Services
    (CMS) has created a standard analytical file that CMS can use to efficiently satisfy
    these requests. It is the intent of CMS to publish the ACO-level public-use file
    (PUF) that contains ACO-specific metrics as well as summarized beneficiary and provider
    information for performance year 1-3 of the Pioneer ACO Model.</p>n",nt"license_title":
